import Timer from './Timer';
import styled from 'styled-components';

const Container = styled.div`
    display: flex;
    justify-content: center;
    align-items: center;
    width: 100%;
    height: 100vh;
`;

const Text = styled.p`
    font-size: 30px;
    font-family: calibri;
    color: black;
`;

const App = () => (
    <Container id="app">
        <Timer></Timer>
    </Container>
);

export default App;
